import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import background from './images/background.jpg'; // Your background image path



function SignIn() {
  const [formData, setFormData] = useState({
    username: '',
    mobile: '',
    password: '',
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('http://localhost:5000/users/login', formData, {
        headers: {
          'Content-Type': 'application/json',
        },
      });

      console.log(response.data);
      navigate('/Home');
    } catch (error) {
      console.error('Error logging in:', error.response ? error.response.data : error.message);
    }
  };

  const backgroundImageStyle = {
    backgroundImage: `url("/background.jpg")`,
    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
    backgroundPosition: 'center',
    height: '100vh',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  };

  const loginFormStyle = {
    backgroundColor: 'rgba(0, 0, 0, 0.7)', // Dark semi-transparent background
    borderRadius: '20px',
    padding: '40px',
    maxWidth: '350px',
    width: '100%',
    boxShadow: '0px 0px 20px rgba(0, 0, 0, 0.5)',
    textAlign: 'center',
  };

  const inputStyle = {
    width: 'calc(100% - 20px)',
    padding: '12px',
    border: '2px solid #007bff', // Blue border for inputs
    borderRadius: '10px',
    marginBottom: '15px',
    backgroundColor: 'rgba(255, 255, 255, 0.9)', // Slightly transparent input background
  };

  const buttonStyle = {
    width: '100%',
    backgroundColor: '#28a745', // Green button color
    color: 'white',
    padding: '12px',
    border: 'none',
    borderRadius: '10px',
    cursor: 'pointer',
    marginBottom: '15px',
    transition: 'background-color 0.3s',
  };

  const buttonHoverStyle = {
    backgroundColor: '#218838', // Darker green on hover
  };

  const linkStyle = {
    color: '#ffcc00', // Bright yellow link color
    textDecoration: 'none',
    display: 'inline-block',
    marginTop: '20px',
  };

  return (
    <div style={backgroundImageStyle}>
      <div style={loginFormStyle}>
        <h2 style={{ marginBottom: '20px', color: '#fff', fontSize: '24px', fontWeight: 'bold' }}>
          Tasker Login
        </h2>
        <form onSubmit={handleSubmit} method="post">
          <div style={{ marginBottom: '20px' }}>
            <label htmlFor="username" style={{ display: 'block', color: '#fff', marginBottom: '5px' }}>
              Username:
            </label>
            <input
              type="text"
              id="username"
              name="username"
              value={formData.username}
              onChange={handleChange}
              style={inputStyle}
              required
            />
          </div>

          <div style={{ marginBottom: '20px' }}>
            <label htmlFor="mobile" style={{ display: 'block', color: '#fff', marginBottom: '5px' }}>
              Registered Mobile No:
            </label>
            <input
              type="text"
              id="mobile"
              name="mobile"
              value={formData.mobile}
              onChange={handleChange}
              style={inputStyle}
              required
            />
          </div>

          <div style={{ marginBottom: '30px' }}>
            <label htmlFor="password" style={{ display: 'block', color: '#fff', marginBottom: '5px' }}>
              Password:
            </label>
            <input
              type="password"
              id="password"
              name="password"
              value={formData.password}
              onChange={handleChange}
              style={inputStyle}
              required
            />
          </div>

          <button
            type="submit"
            style={{ ...buttonStyle }}
            onMouseOver={(e) => (e.target.style.backgroundColor = buttonHoverStyle.backgroundColor)}
            onMouseOut={(e) => (e.target.style.backgroundColor = buttonStyle.backgroundColor)}
          >
            Login
          </button>
        </form>

        <div>
          <a href="/Home" style={linkStyle}>Go to Home</a>
        </div>
      </div>
    </div>
  );
}

export default SignIn;
